import Vue from 'vue';
import Router from 'vue-router';
Vue.use(Router);
/* Layout */

import Layout from '@/layout';
export default new Router({
  mode: 'hash',
  routes: [// {
  //   path: '/',
  //   name: 'HelloWorld',
  //   component: HelloWorld
  // }
  {
    path: '/',
    component: Layout,
    redirect: '/project',
    children: [{
      path: 'project',
      component: function component() {
        return import('@/views/project');
      },
      name: 'Project'
    }]
  }, {
    path: '/graph/',
    component: Layout,
    hidden: true,
    children: [{
      path: ':id',
      component: function component() {
        return import('@/components/G6Editor');
      },
      name: 'Graph'
    }]
  }, {
    path: '/personal/',
    component: Layout,
    hidden: true,
    children: [{
      path: ':id',
      component: function component() {
        return import('@/components/PersonalCenter/PersonalCenter');
      },
      name: 'Graph'
    }]
  }, {
    path: '*',
    name: 'NotFound',
    redirect: '/project'
  }, {
    path: '/login',
    component: function component() {
      return import('@/views/login/index');
    }
  }, {
    path: '/register',
    component: function component() {
      return import('@/views/register/index');
    }
  }]
});
